def check_format (runid, ext = "pred", lang="English"):
	"""
	:param runid: stringa che identifica la run di cui fare lo score, nel formato -> <subtask>_* , <subtask>  la lettera identificativa del subtask
	:param ext: "pred" o "gold" a seconda del file di cui si vuole controllare il formato
	:param lang: default English

	Restituisce True se il file  ben formato, False altrimenti

	"""
	ret = True

	subtask = runid.split("_")[0]

	scriptname = "format_checker/SemEval2016_task3_"+lang+"_format_checker_subtask"+subtask+".pl"
	filename = "../outputfiles/"+runid+"."+ext


	proc = subprocess.run(['perl', scriptname, filename],stdout=subprocess.PIPE)
	retval = proc.returncode
	if not retval == 0:
		ret = False
		print("[Scorer] errore nel formato del file: ")
